(185, 3, 1, 1, '<p><span style=\"color:#3498db\"><span style=\"font-size:18px\"><strong>Zinedine Zidane est un joueur de football fran&ccedil;ais tr&egrave;s c&eacute;l&egrave;bre. Il est devenu un grand h&eacute;ros quand il a marqu&eacute; deux buts pendant la finale de la Coupe du Monde au stade de France en 1998. La finale de la Coupe du Monde contre le Br&eacute;sil a &eacute;t&eacute; un grand moment dans sa carri&egrave;re. Il a marqu&eacute; deux buts pendant le match, puis un autre joueur, Emmanuel Petit, a inscrit un troisi&egrave;me but. Il a jou&eacute; dans des &eacute;quipes diff&eacute;rentes, par exemple Cannes,Bordeaux et Turin (une &eacute;quipe italienne) et bien s&ucirc;r dans l&#39;&eacute;quipe nationale de France. Zinedine Zidane est mari&eacute; et a deux enfants, Enzo et Lucas</strong></span></span></p>\r\n\r\n<p><span style=\"color:#c0392b\"><span style=\"font-size:28px\"><strong>1 - &nbsp;Ce document parle principalement de &hellip;&hellip;&hellip;</strong></span></span></p>\r\n', 'Emmanuel petit', 'Zinedine Zidane', 'Lucas', 'Enzo', '2'),
