(192, 3, 1, 8, '<p><span style=\"color:#3498db\"><span style=\"font-size:22px\"><strong>Vous faites du sport ? Vous &ecirc;tes pour ou contre ?</strong></span></span></p>\r\n\r\n<p><span style=\"color:#3498db\"><span style=\"font-size:22px\"><strong>Jean (17 ans) : &nbsp;Je suis lyc&eacute;en. J&rsquo;ai beaucoup de mati&egrave;res &agrave; apprendre. J&rsquo;ai plusieurs devoirs &agrave; faire. Je n&rsquo;ai pas le temps de faire du sport mais j&rsquo;aime bien le foot. Je suis parfois des matchs de foot &agrave; la t&eacute;l&eacute; quand je suis libre.</strong></span></span></p>\r\n\r\n<p><span style=\"color:#3498db\"><span style=\"font-size:22px\"><strong>Mathilde (24 ans) : &nbsp;Je suis pharmacienne. Je fais du sport r&eacute;guli&egrave;rement surtout la natation. J&rsquo;aime beaucoup ce sport. &nbsp;En vacances, quand je vais chez mon oncle je fais du VTT avec mon cousin.</strong></span></span></p>\r\n\r\n<p><span style=\"color:#3498db\"><span style=\"font-size:22px\"><strong>Jaques (42 ans) : &nbsp;Je suis banquier. J&rsquo;ai une petite famille de quatre personnes. Nous faisons ensemble du tennis le weekend seulement. Je suis ravi &nbsp;سعيد de pratiquer le sport car mes enfants aiment &ccedil;a.</strong></span></span></p>\r\n\r\n<p><span style=\"color:#3498db\"><span style=\"font-size:22px\"><strong>Sandra (20 ans) : &nbsp;Je suis &eacute;tudiante. J&rsquo;aime les sports. Chaque mois je vais &agrave; la montagne pour faire de l&rsquo;escalade. C&rsquo;est un sport dangereux. Chaque semaine j&rsquo;aime faire du v&eacute;lo dans ma ville avec mes fr&egrave;res.</strong></span></span></p>\r\n\r\n<p><span style=\"color:#c0392b\"><span style=\"font-size:28px\"><strong>8 - Ce document est ...........</strong></span></span></p>\r\n', 'une lettre', 'une enquete', 'un mél', 'un article', '2'),
