(294, 3, 2, 17, '<p style=\"text-align:center\"><span style=\"font-size:28px\"><span style=\"color:#c0392b\"><strong><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">Voici les opinions de quelques &eacute;l&egrave;ves d&rsquo;une &eacute;cole secondaire.</span></strong></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:28px\"><span style=\"color:#c0392b\"><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">Adeline </span></span><span style=\"color:#000000\"><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">: J&rsquo;adore jouer au tennis. Chaque jour, je passe une heure apr&egrave;s l&rsquo;&eacute;cole &agrave; m&rsquo;entrainer au club. Jannick Noah est mon tennisman pr&eacute;f&eacute;r&eacute;.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:28px\"><span style=\"color:#c0392b\"><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">Fran&ccedil;ois </span></span><span style=\"color:#000000\"><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">: Moi, je fais de la natation, Je nage au moins trois fois par semaine &agrave; la piscine du club.</span></span></span></p>\r\n\r\n<p><span style=\"color:#c0392b\"><span style=\"font-size:28px\"><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">Camille </span></span></span><span style=\"color:#000000\"><span style=\"font-size:28px\"><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">: J&#39;aime le football,&nbsp; je ne le pratique pas du tout. C&rsquo;est mon fr&egrave;re qui le pratique cinq jours par semaine.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:28px\"><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\"><span style=\"color:#c0392b\">Pauline </span>:<span style=\"color:#000000\"> Moi, je n&rsquo;aime</span></span><span style=\"color:#000000\"><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\"> </span> <span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">pas du tout le football. Pendant les vacances, chaque jeudi, je vais au club pour voir mes amis</span> </span></span></p>\r\n\r\n<p><span style=\"color:#c0392b\"><span style=\"font-size:28px\"><strong><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">17- Ces &eacute;l&egrave;ves parlent </span></strong> .................</span></span></p>\r\n', 'du sport', 'du lycée', 'des vacances', 'du travail', '1'),
