(301, 3, 2, 24, '<p style=\"margin-left:9px\"><strong><span style=\"font-size:28px\"><span style=\"color:#c0392b\"><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">&nbsp;&nbsp; Salut !</span></span></span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:28px\"><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Je passe de super vacances au Qu&eacute;bec au Canada chez des amis de mes parents. Ils ont une maison au bord d&rsquo;un lac, au milieu de la for&ecirc;t. Il fait tr&egrave;s beau. Chaque matin, toute la famille aime aller &agrave; la p&ecirc;che, et aussi faire des promenades &agrave; v&eacute;lo. Demain, je vais aller &agrave; une soir&eacute;e chez des voisins, des jeunes tr&egrave;s sympas. Un seul probl&egrave;me, je ne peux pas pratiquer le kitesurf, mon sport pr&eacute;f&eacute;r&eacute;. Je te souhaites de bonnes vacances, &agrave; Alexandrie.&nbsp; Nous allons rentrer le premier ao&ucirc;t.</span></span></p>\r\n\r\n<p><span style=\"font-size:28px\"><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">Au revoir</span> </strong></span></p>\r\n\r\n<p><strong><span style=\"color:#c0392b\"><span style=\"font-size:28px\">24-Ce document est .............</span></span></strong></p>\r\n', 'une letrre', 'un dialogue', 'un article', 'un mél', '4'),
