(379, 3, 3, 32, '<p><span style=\"font-size:28px\"><span style=\"color:#c0392b\"><strong><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">Bonjour &agrave; tous !</span></strong></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:28px\"><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">Je m&#39;appelle Martine, j&#39;ai 17 ans, je suis fran&ccedil;aise et je cherche&nbsp; un (e) correspondant(e) pour parler de nos habitudes</span><span dir=\"RTL\" lang=\"AR-EG\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">عادات </span></span><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">, de nos loisirs et de nos passions. Moi, j&#39;aime faire du sport, je joue au tennis tous les dimanches. J&#39;aime bien aider ma m&egrave;re &agrave; la maison, mais je n&#39;aime pas beaucoup regarder la t&eacute;l&eacute;vision (sauf les matchs de foot). </span>&nbsp;&nbsp;&nbsp;<span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">Et toi, que fais-tu pendant ton temps libre ? </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:28px\"><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">Quels sports pratiques-tu ? Si tu veux correspondre</span><span dir=\"RTL\" lang=\"AR-SA\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">تراسل </span></span><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">&nbsp;avec moi, r&eacute;ponds-moi vite </span> </span></p>\r\n\r\n<p><span style=\"color:#c0392b\"><span style=\"font-size:28px\"><strong><span style=\"font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;\">32- Martine va parler avec la nouvelle amie&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ...........................</span></strong></span></span></p>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n', 'des aliments', 'de